                function cutsceneAccountantFound(npc)
                {
                    npc.setPersonalityId("accountantSecret")
                    npc.scenePlay("accountant_cityIntro1")
                    charIntroPlay("accountant")
                    npc.setPersonalityId("accountant")
                    npc.scenePlay("accountant_cityIntro2")
                    wait(0.25)
                    cameraCloseFadeFast()
                    flag("g:accountantFound").set(2)
                    wait(1)
                    cameraOpenFadeFast()
                    timesplitAdd("accountantMet")
                    checkpointSet()
                }

