                function handlePopcornSeller()
                {
                    const price = 15
                    const popcorn = obj("popcornBucket")

                    if (popcorn.count() != 1 ||
                        popcorn.isActive())
                    {
                        this.scenePlay("city_popcornSellerAdvice")
                        return
                    }

                    dialogueSubstSetPrice("price", price)

                    const d = this.scenePlay("city_popcornSellerAsk")
                    
                    if (d.chosen != 0)
                        { return }

                    if (!moneyTrySpend(price))
                    {
                        this.scenePlay("city_popcornSellerNotEnoughMoney")
                        return
                    }

                    this.scenePlay("city_popcornSellerBought")
                    
                    popcorn.activate()
                    player().tryHold(popcorn)
                    
                    this.scenePlay("city_popcornSellerAdvice")
                }

                function handleTaxiPhone()
                {
                    const priceUnlock = taxiPhoneGetUnlockPrice(this)

                    if (!taxiPhoneIsUnlocked(this))
                    {
                        dialogueSubstSetPrice("price", priceUnlock)
                        var d = this.scenePlay("taxiPhone_unlock")
                        if (d.chosen != 0)
                            { return }

                        if (!moneyTrySpend(priceUnlock))
                        {
                            this.scenePlay("taxiPhone_unlockNoMoney")
                            return
                        }
                        
                        taxiPhoneUnlock(this)
                        soundPlayCongrats()
                        this.scenePlay("taxiPhone_unlockSuccess")
                        this.refresh()
                        checkpointSet()
                        return
                    }

                    this.scenePlay("taxiPhone_unlocked")

                    var selectedTaxiPhone = taxiPhoneMapOpen(this)
                    if (selectedTaxiPhone == "")
                        { return }

                    wait(0.5)

                    taxiPhoneEmbark(this, selectedTaxiPhone)
                }

                function handleBurgerQuest(
                    owner,
                    flagName,
                    scRequest1,
                    scRequest2,
                    scRequestAccepted,
                    scRequestDenied,
                    scNoItem,
                    scWithItem,
                    scItemConsumed,
                    scComplete)
                {
                    var burgerFlag = flag(flagName)

                    if (burgerFlag.get() == 0)
                    {
                        owner.scenePlay(scRequest1)
                        var d = this.scenePlay(scRequest2)
                        if (d.chosen == 0)
                        {
                            this.scenePlay(scRequestAccepted)
                            burgerFlag.set(1)
                            checkpointSet()
                        }
                        else
                        {
                            //this.scenePlay(scRequestDenied)
                        }
                    }
                    else if (burgerFlag.get() == 1)
                    {
                        var heldItem = player().getHeldItem()
                        if (heldItem.defName != "burger")
                        {
                            this.scenePlay(scNoItem)
                        }
                        else
                        {
                            this.scenePlay(scWithItem)
                            player().holderCancel()
                            heldItem.destroyWithPoof()

                            this.scenePlay(scItemConsumed)
                            wait(0.25)
                            burgerFlag.set(2)
                            checkpointSet()
                        }
                    }
                    else
                    {
                        this.scenePlay(scComplete)
                    }
                }
                
