                function handleBirdLady(
                    storyCondition,
                    storySceneId)
                {
                    const flagIntro = flag("g:birdLadyIntro")
                    const flagTipIndex = flag("g:birdLadyTipIndex")
                    const flagStory = flag("birdLadyStory")

                    if (!flagIntro.isOn())
                    {
                        this.scenePlay("birdLady_intro")
                        flagIntro.set(1)
                        checkpointSet()
                        return
                    }

                    if (storyCondition &&
                        !flagStory.isOn())
                    {
                        this.scenePlay(storySceneId)
                        flagStory.set(1)
                        checkpointSet()
                        return
                    }

                    this.scenePlay("birdLady_giveTip")

                    var tipData = birdLadyBuildTipList()
                    
                    var tipIndex = flagTipIndex.get()
                    flagTipIndex.inc()

                    var chosenTipSceneId = tipData.list.at(tipIndex % tipData.list.len)
                    if (tipData.forceSceneId != "")
                    {
                        chosenTipSceneId = tipData.forceSceneId
                    }

                    this.scenePlay(chosenTipSceneId)
                    flag("g:" + chosenTipSceneId).set(1)

                    if (birdLadyBuildTipList().forceSceneId == "")
                        { this.setNotification("") }
                            
                    checkpointSet()
                }

                function birdLadyBuildTipList()
                {
                    const tipData = new {
                        list = [],
                        forceSceneId = "",
                    }

                    birdLadyAddTip(tipData, "birdLady_tip_jumpInvuln", true)
                    birdLadyAddTip(tipData, "birdLady_tip_returnToSafeHouse", true)
                    birdLadyAddTip(tipData, "birdLady_tip_yoyoRecoveryBoost", true)
                    birdLadyAddTip(tipData, "birdLady_tip_wallDashStall", flag("g:ability:wallDash").isOn())
                    birdLadyAddTip(tipData, "birdLady_tip_walkTheDogOnce", flag("g:ability:walkTheDog").isOn())
                    birdLadyAddTip(tipData, "birdLady_tip_parryReset", flag("g:ability:specialParry").isOn())
                    birdLadyAddTip(tipData, "birdLady_tip_parryPerfect", flag("g:ability:specialParry").isOn())
                    birdLadyAddTip(tipData, "birdLady_tip_spinProjectiles", flag("g:ability:specialSpin").isOn())
                    birdLadyAddTip(tipData, "birdLady_tip_safeHouseStorage", flag("g:megaBattery1").isOn() && flag("g:megaBattery2").isOn())

                    tipData.list.shuffle(defeatCounterGet())

                    return tipData
                }

                function birdLadyAddTip(
                    tipData,
                    tipSceneId,
                    tipCondition)
                {
                    const flagTip = flag("g:" + tipSceneId)

                    if (!tipCondition)
                        { return }

                    tipData.list.push(tipSceneId)
                    
                    if (!flagTip.isOn() &&
                        tipData.forceSceneId == "")
                    {
                        tipData.forceSceneId = tipSceneId
                    }
                }

                function birdLadyHasNotification()
                {
                    const flagIntro = flag("g:birdLadyIntro")

                    if (!flagIntro.isOn())
                        { return true }

                    var tipData = birdLadyBuildTipList()

                    if (tipData.forceSceneId != "")
                        { return true }

                    return false
                }
